/*Table structure for table `delayed_steps` */

DROP TABLE IF EXISTS `delayed_steps`;

CREATE TABLE `delayed_steps` (
  `id` int(5) unsigned NOT NULL AUTO_INCREMENT,
  `type` varchar(30) NOT NULL,
  `dependencies` varchar(100) DEFAULT NULL,
  `parameters` text,
  `created_at` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `server_id` int(5) unsigned NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Table structure for table `event_logs` */

DROP TABLE IF EXISTS `event_logs`;

CREATE TABLE `event_logs` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `event` varchar(50) NOT NULL,
  `server_id` int(11) NOT NULL,
  `source` enum('ansible','api','console') NOT NULL,
  `started_at` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `finished_at` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00',
  `customer_number` int(11) DEFAULT NULL,
  `admin_id` int(11) DEFAULT NULL,
  `team_member_id` int(11) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

/*Table structure for table `git_info` */

DROP TABLE IF EXISTS `git_info`;

CREATE TABLE `git_info` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `app_id` int(11) DEFAULT NULL,
  `git_url` varchar(300) DEFAULT NULL,
  `git_branch` varchar(100) DEFAULT NULL,
  `git_branch_list` varchar(200) NOT NULL,
  `deploy_path` varchar(200) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

/*Table structure for table `inactive_trials` */

DROP TABLE IF EXISTS `inactive_trials`;

CREATE TABLE `inactive_trials` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `server_id` int(11) NOT NULL,
  `stopped_at` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00',
  `deleted_at` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

/*Table structure for table `migrations` */

DROP TABLE IF EXISTS `migrations`;

CREATE TABLE `migrations` (
  `version` int(3) NOT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Table structure for table `nonpaying_servers` */

DROP TABLE IF EXISTS `nonpaying_servers`;

CREATE TABLE `nonpaying_servers` (
  `id` int(9) NOT NULL AUTO_INCREMENT,
  `server_id` int(5) unsigned NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Table structure for table `operations` */

DROP TABLE IF EXISTS `operations`;

CREATE TABLE `operations` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `type` varchar(25) NOT NULL,
  `status` varchar(200) NOT NULL,
  `is_completed` tinyint(1) NOT NULL,
  `parameters` text NOT NULL,
  `created_at` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00',
  `updated_at` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `customer_id` int(11) NOT NULL,
  `server_id` int(11) NOT NULL,
  `app_id` int(5) unsigned DEFAULT NULL,
  `notes` text NOT NULL,
  `estimated_time_remaining` int(11) NOT NULL,
  `frontend_step_number` int(11) NOT NULL DEFAULT '1',
  `start_after` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00',
  `key` varchar(5) NOT NULL,
  `hidden` tinyint(1) NOT NULL DEFAULT '0',
  `is_ready` tinyint(4) NOT NULL DEFAULT '1',
  PRIMARY KEY (`id`),
  KEY `is_completed` (`is_completed`),
  KEY `server_id` (`server_id`),
  KEY `customer_id` (`customer_id`)
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=latin1;

