/*Table structure for table `server_packages` */

DROP TABLE IF EXISTS `server_packages`;

CREATE TABLE `server_packages` (
  `id` int(9) NOT NULL AUTO_INCREMENT,
  `server_id` int(5) unsigned NOT NULL,
  `package_name` varchar(50) NOT NULL,
  `package_version` varchar(50) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Table structure for table `servers` */

DROP TABLE IF EXISTS `servers`;

CREATE TABLE `servers` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `label` varchar(40) NOT NULL,
  `status` varchar(20) NOT NULL,
  `tenant_id` int(11) NOT NULL,
  `cloud` varchar(20) NOT NULL,
  `region` varchar(20) NOT NULL,
  `zone` varchar(30) DEFAULT NULL,
  `instance_type` varchar(20) NOT NULL,
  `db_volume_size` int(11) DEFAULT NULL,
  `data_volume_size` int(11) DEFAULT NULL,
  `volume_size` int(11) DEFAULT NULL,
  `instance_id` varchar(45) NOT NULL,
  `root_volume_id` varchar(30) DEFAULT NULL,
  `data_volume_id` varchar(80) DEFAULT NULL,
  `db_volume_id` varchar(80) DEFAULT NULL,
  `public_ip` varchar(25) NOT NULL,
  `ip_allocation_id` varchar(100) DEFAULT NULL,
  `customer_id` varchar(20) NOT NULL,
  `root_password` varchar(500) NOT NULL,
  `mysql_root_password` varchar(50) NOT NULL,
  `customer_email` varchar(50) NOT NULL,
  `s3_bucket_name` varchar(50) NOT NULL,
  `s3_folder_name` varchar(100) NOT NULL,
  `aws_access_key_id` varchar(100) NOT NULL,
  `aws_secret_access_key` varchar(100) NOT NULL,
  `iam_user` varchar(50) NOT NULL,
  `server_fqdn` varchar(50) NOT NULL,
  `backup_frequency` varchar(11) NOT NULL,
  `is_terminated` tinyint(1) NOT NULL DEFAULT '0',
  `created_at` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00',
  `updated_at` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `is_trial` tinyint(4) NOT NULL,
  `backup_size` decimal(10,6) DEFAULT NULL,
  `backup_size_time` timestamp NULL DEFAULT NULL,
  `playbook_status` int(11) NOT NULL DEFAULT '0',
  `local_backups` varchar(3) DEFAULT 'no',
  `source_server_fqdn` varchar(50) DEFAULT NULL,
  `master_user` varchar(100) DEFAULT NULL,
  `master_password` varchar(100) DEFAULT NULL,
  `virtualization_type` varchar(20) DEFAULT NULL,
  `platform` varchar(15) NOT NULL DEFAULT 'debian7',
  `snapshot_frequency` int(5) unsigned DEFAULT NULL,
  `memory_size` int(11) DEFAULT NULL,
  `autoscale_policy` text,
  `storage_type` varchar(20) DEFAULT NULL,
  `backup_retention` int(10) unsigned NOT NULL DEFAULT '8',
  PRIMARY KEY (`id`),
  KEY `customer_id` (`customer_id`)
) ENGINE=InnoDB AUTO_INCREMENT=83573 DEFAULT CHARSET=latin1;

