/*Table structure for table `ssh_keys` */

DROP TABLE IF EXISTS `ssh_keys`;

CREATE TABLE `ssh_keys` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `label` varchar(100) NOT NULL,
  `key` varchar(1000) NOT NULL,
  `app_creds_id` int(11) DEFAULT NULL,
  `server_id` int(11) DEFAULT NULL,
  `created_at` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00',
  `updated_at` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

/*Table structure for table `ssl_info` */

DROP TABLE IF EXISTS `ssl_info`;

CREATE TABLE `ssl_info` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `ref_id` int(11) NOT NULL,
  `type` varchar(10) NOT NULL,
  `text` mediumtext NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

/*Table structure for table `step_types` */

DROP TABLE IF EXISTS `step_types`;

CREATE TABLE `step_types` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(20) NOT NULL,
  `estimated_time` int(5) NOT NULL,
  `completes_step` tinyint(1) NOT NULL DEFAULT '0',
  `operation_type` varchar(50) DEFAULT NULL,
  `cloud` varchar(25) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

/*Table structure for table `steps` */

DROP TABLE IF EXISTS `steps`;

CREATE TABLE `steps` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `operation_id` int(11) NOT NULL,
  `type` varchar(50) DEFAULT NULL,
  `state` varchar(25) NOT NULL,
  `parameters` varchar(3000) DEFAULT NULL,
  `dependencies` varchar(50) NOT NULL,
  `result` text NOT NULL,
  `is_picked` tinyint(1) NOT NULL DEFAULT '0',
  `created_at` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00',
  `updated_at` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `retry_count` int(5) NOT NULL DEFAULT '0',
  `check_after` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00',
  `initiated_at` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00',
  `distribution_number` int(11) NOT NULL,
  PRIMARY KEY (`id`),
  KEY `operation_id` (`operation_id`),
  KEY `state` (`state`),
